How to target watch stream to limited sets of data?<p>So I want to use Mongodb change streams to watch updates on specific sets of data.</p>

<p>For example likes </p>

<pre><code>await Match.updateOne({matchId: 79949451}, {$set: {statusType: 'inprogress'}}).exec();

const pipeline = [{ $match: { matchId: 79949451}}];
Match.watch(pipeline).on('change', data =&gt; console.log(data));

await Match.updateOne({matchId: 79949451}, {$set: {statusType: 'finished'}}).exec();
</code></pre>

<p>This doesn't seems to work. StatusType get updated, but i don't get the log.  </p>

<p>But if I removed the pipeline , i see the log</p>

<pre><code>await Match.updateOne({matchId: 79949451}, {$set: {statusType: 'inprogress'}}).exec();

Match.watch().on('change', data =&gt; console.log(data));

await Match.updateOne({matchId: 79949451}, {$set: {statusType: 'finished'}}).exec();
</code></pre>

<p>Upto what I read and understand that pipeline only work on updated fields and something have to do with <code>fullDocument</code>.</p>

<p>How can I make this to work ? Is there anything simple I am missing?</p>

