$match and update a certain key in object after $unwind in MongoDB<p>I have documents like the following one:</p>

<pre><code>{ 
    "_id" : ObjectId("5dc027d38da295b969eca67c"), 
    "emp_no" : 10031, 
    "salaries" : [
        {
            "salary" : 40000, 
            "from_date" : "1991-09-01", 
            "to_date" : "1992-08-31"
        }, 
        {
            "salary" : 40859, 
            "from_date" : "1992-08-31", 
            "to_date" : "1993-08-31"
        }, 
        {
            "salary" : 41881, 
            "from_date" : "1993-08-31", 
            "to_date" : "1994-08-31"
        }
    ]
}
</code></pre>

<p>As a goal I need to increment <code>salary</code> by 1000 for every object that has <code>from_date</code> key in a range of <em>1985-01-01</em> - <em>1985-12-31</em>. <br>
So far i came up with this query:</p>

<pre><code>db.emp_salaries.aggregate( [
  { $unwind: "$salaries" },
  { $match: {
    "salaries.from_date": {$gte: "1985-01-01"},
