<p>but i can't target <code>from_date</code> key this way. I have no idea how to do this. This <code>$match</code> seems to be totally ignored. I've heard about an operator which can automatically target such a key regardless of its position from the beginning of an object, but couldn't find it back.<br>
How do I target this key and perform an update on <code>salary</code>?</p>

